import React from 'react';
import data from '../data';

import './table.css';

export default class Table extends React.Component {
    render () {
        return (
            <React.Fragment>
                <table>
                    <tr>
                        <td>{data.name}</td>
                    </tr>
                </table>
            </React.Fragment>
        )
    }
}
